                          }


                          var digitalcartListSubtotal = document.getElementById('digitalcartListSubtotal');
                          var digitalcartListCheckout = document.getElementById('digitalcartListCheckout');

                          digitalCount = parseInt(res["itemCount"]);
                          countContainer.innerHTML = physicalCount + digitalCount;

                          if (res["itemCount"] == "0") {
                              digitalcartListSubtotal.innerHTML = "Your digital cart is empty."
                              digitalcartListCheckout.className = "hide";
                              //digitalcartLink.onmouseover = null;
                              //digitalcartLink.href = "javascript:void(0)";
                              digitalcartListItemCount.innerHTML = "";
                          }
                          else {
                              digitalcartListSubtotal.innerHTML = "Subtotal: " + res["itemTotal"];
                              digitalcartListCheckout.className = "digitalcartListCheckout";
                          }

                          if ((physicalCount + digitalCount) == 0) {
                              cartLink.onmouseover = null;
                              cartLink.href = "javascript:void(0)";
                          }


                          var digitalcartListing = document.getElementById('digitalcartListing');
                          digitalcartListing.innerHTML = res["itemLister"];


                          var digitalcartAlert = document.getElementById('digitalcartAlert');
                          //var digitalcartLink2 = document.getElementById('digitalcartLink');
                          if ("" + res["hasAlert"] == "true") {
